    a = [list(input()) for _ in range(h)]

    for i in range(w):
        for j in range(h):
            if a[j][i] ==".":
                wc, bc, res = bfs(j, i)
                if wc>0 and bc==0:
                    wans+=res
                elif wc==0 and bc>0:
                    bans+=res
